import React from "react";

class Login extends React.Component {
  constructor() {
    super();
    this.state = { email: "", password: "" };
    this.handleChange = this.handleChange.bind(this);
    this.submit = this.submit.bind(this);
  }
  handleChange(event) {
    this.setState((prevState) => {
      return { email: prevState.email, password: prevState.password };
    });
  }
  submit() {}
  render() {
    return (
      <div>
        <form>
          <input onChange={this.handleChange(event)} type="text" />
          <input onChange={this.handleChange(event)} type="password" />
          <input onClick={this.submit()} type="submit" value="Login" />
        </form>
      </div>
    );
  }
}

export default Login;
